import React, { Component } from 'react'
import SearchButton from "./../components/searchButton"

class ScheduleMedicalAppoinment extends Component {
    state = {
        patientIdentity: ''
    }
    //se instalo npm install material-design-icons react-bootstrap bootstrap
    handleSubmitPatientId = (evt) => {
        console.log(' evt.target.value', evt.target.value)
        console.log('patientId', this.state.patientId)
        this.setState({
            open: evt.target.value
        })
    }

    render() {
        const { patientId, handleSubmitPatientId } = this.state
        return (
            <div>
                <SearchButton patientId={patientId} handleSubmitPatientId={ handleSubmitPatientId } />
            </div>
        )
    }
}
export default ScheduleMedicalAppoinment;
